// HasSupplier applies the HasEdge predicate on the "supplier" edge.
func HasSupplier() predicate.PurchaseInvoice {
	return predicate.PurchaseInvoice(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.To(SupplierTable, FieldID),
			sqlgraph.Edge(sqlgraph.M2O, false, SupplierTable, SupplierColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasSupplierWith applies the HasEdge predicate on the "supplier" edge with a given conditions (other predicates).
func HasSupplierWith(preds ...predicate.Supplier) predicate.PurchaseInvoice {
	return predicate.PurchaseInvoice(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.To(SupplierInverseTable, FieldID),
			sqlgraph.Edge(sqlgraph.M2O, false, SupplierTable, SupplierColumn),
		)
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// And groups predicates with the AND operator between them.
func And(predicates ...predicate.PurchaseInvoice) predicate.PurchaseInvoice {
	return predicate.PurchaseInvoice(func(s *sql.Selector) {
		s1 := s.Clone().SetP(nil)
		for _, p := range predicates {
			p(s1)
		}
		s.Where(s1.P())
	})
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.PurchaseInvoice) predicate.PurchaseInvoice {
	return predicate.PurchaseInvoice(func(s *sql.Selector) {
		s1 := s.Clone().SetP(nil)
		for i, p := range predicates {
			if i > 0 {
				s1.Or()
			}
			p(s1)
		}
		s.Where(s1.P())
	})
}

// Not applies the not operator on the given predicate.
func Not(p predicate.PurchaseInvoice) predicate.PurchaseInvoice {
	return predicate.PurchaseInvoice(func(s *sql.Selector) {
		p(s.Not())
	})
}
